import logo from './logo.svg';
import './App.css';
import Post from "./post"
import Header from './header';
import {Routes , Route} from 'react-router-dom'
/*
inside element in rout we define the structure of the page which will open 
*/
function App() {
  return (

    <Routes>
      <Route index element={
    <main>
    <Header />
    <Post />
    <Post/>
    <Post />
   </main>}/>

   <Route path='/login' element={
    <div>login</div>
   }></Route>
    </Routes>

  );
}

export default App;
